import React, { useEffect, useState } from "react";
import { useParams } from "react-router";
import firebase from "firebase";
import roomImg from "../../../../Assets/Images/room.png";
import userImg from "../../../../Assets/Images/user.png";
import styles from "../../index.module.scss";

function PollResults() {
  const [pollData, setPollData] = useState({});
  const [users, setUsers] = useState([]);
  let { pollId } = useParams();

  useEffect(() => {
    const data = {
      _id: "ad41e2bd-5615-4d06-b797-0ab11ee4dbdc",
      roomName: "TestGame",
      allCanSee: false,
      series: [
        { entryValue: "0", count: 0 },
        { entryValue: "1", count: 0 },
        { entryValue: "2", count: 0 },
        { entryValue: "3", count: 0 },
        { entryValue: "5", count: 0 },
        { entryValue: "8", count: 0 },
        { entryValue: "13", count: 0 },
        { entryValue: "21", count: 0 },
      ],
      isSpectator: null,
    };
    setPollData(data);
    const userRef = firebase.database().ref(pollId);
  }, []);

  return (
    <div className={styles.resultsWrapper}>
      <div className={styles.cardHeader}>
        <div className={styles.pollName}>
          <img src={roomImg} alt="RoomName" className={styles.roomImg} />
          {pollData.roomName}
        </div>
        <div className={styles.logged}>
          <img src={userImg} alt="User" className={styles.userImg} />
          {window.localStorage.getItem("loggedUser")}
        </div>
      </div>
    </div>
  );
}

export default PollResults;
